import React from 'react';
import {Link} from 'react-router-dom';


function CenterItem(props) {
  return (
      <>
        <li>
          <div>
              <figure data-category={props.label}>
              
                    <img
                    alt=''
                    src={props.src}
                    />
              
              </figure>
              </div>
              <div>
                  <h3>{props.text}</h3>
                  <h3>{props.text2}</h3>
              </div>
        </li>
      </>
  );
}

export default CenterItem;
